const Header = () => {
  const Navigate = useNavigate();
   
  return (
    <div>
      <Navbar bg="dark" varient="dark">
        <Navbar.Brand>USER ID: 06PP125</Navbar.Brand>
        <NavDropdown title="User Name"> </NavDropdown>
      </Navbar>
    </div>
  );
};
export default Header;




